	function is_av(frac, magic, level)
	{
		var av_magic =
		{
			'knight':		['light', 'dark'],
			'necr':			['dark', 'nature'],
			'mage':			['light', 'nature', 'chaos'],
			'elf':			['light', 'nature'],
			'barb':			['none'],
			'darkElf':		['dark', 'chaos'],
			'demon':		['dark', 'chaos'],
			'gnome':		['light', 'chaos']
		};
		for ( var i = 0; i < av_magic[frac].length; i++ )
		{
			if ( av_magic[frac][i] == magic )
				return (frac == 'mage' && magic == 'light') ? (level >= 10 ? true : false) : true;
		}
		return false;
	}
	
	function damage( spell_power, perkLevel, base0, added0, base1, added1, base2, added2, base3, added3)
	{
		var dam =
		{
			0: (Number(base0) + (Number(added0) * spell_power)),
			1: (Number(base1) + (Number(added1) * spell_power)),
			2: (Number(base2) + (Number(added2) * spell_power)),
			3: (Number(base3) + (Number(added3) * spell_power))
		};
		return Math.round(dam[perkLevel] - 0.5);
	}
	
	function checkSet(set)
	{
		var arts = new Array();
		for ( var i = 1; i < 10; i++ )
		{
			var slot = document.getElementById('slot' + i);
			if (slot.getElementsByTagName('a').length > 0)
			{
				var art = slot.getElementsByTagName('a')[0].href.substring(slot.getElementsByTagName('a')[0].href.indexOf('art_info.php?id=') + 'art_info.php?id='.length, slot.getElementsByTagName('a')[0].href.indexOf('&uid=') != -1 ? slot.getElementsByTagName('a')[0].href.indexOf('&uid=') : slot.getElementsByTagName('a')[0].href.length);
				arts[i] = art;
			}
			else
			{
				arts[i] = 'none';
			}
		}
		var sets = new Array();
		switch(set)
		{
			case 'druid':
				sets[5] = 'druid_staff';
				sets[7] = 'druid_boots';
				sets[4] = 'druid_cloack';
				sets[3] = 'druid_armor';
				sets[2] = 'druid_amulet';
				break;
			case 'demon':
				sets[5] = 'dem_axe';
				sets[6] = 'dem_shield';
				sets[7] = 'dem_bootshields';
				sets[3] = 'dem_armor';
				sets[2] = 'dem_amulet';
				sets[1] = 'dem_helmet';
				break;
			case 'paladin':
				sets[5] = 'paladin_sword';
				sets[6] = 'paladin_shield';
				sets[7] = 'paladin_boots';
				sets[3] = 'paladin_armor';
				sets[1] = 'paladin_helmet';
				sets[4] = 'paladin_bow';
				break;
		}
		for ( var i = 1; i < 10; i++ )
		{
			if (sets[i] != undefined)
			{
				if (sets[i] != arts[i])
					return false;
			}
		}
		return true;
	}
	
	function checkForUpdates( metadata )
	{
		var date = new Date();
		var today = date.getDate() + '.' + date.getMonth() + '.' + date.getFullYear();
		var lastDay = GM_getValue('lastDate', '');
		if ( today != lastDay )
		{
			GM_setValue('lastDate', today);
			var metadata = toMetadata( metadata );
			var homepage = metadata['homepage'];
			var script_id = homepage.substring( homepage.indexOf('/scripts/show/') + '/scripts/show/'.length );
			GM_xmlhttpRequest(
			{
				method: 'GET',
				url: 'http://userscripts.org/scripts/source/' + script_id + '.meta.js',
				headers:
				{
					'User-agent': 'Mozilla/5.0 (Windows; U; Windows NT 5.1; ru; rv:1.8.1)',
					'Accept': 'text /xml,application/xml,application/xhtml+xml,text/html',
					'Content-type': 'application/x-www-form-urlencoded'
				},
				onload: function(resp)
				{
					var newMetadata = toMetadata( resp.responseText );
					if ( metadata['version'] != newMetadata['version'] && confirm(metadata['name'] + ': \u0414\u043e\u0441\u0442\u0443\u043f\u043d\u043e \u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0441\u043a\u0440\u0438\u043f\u0442\u0430!\n\u041e\u0431\u043d\u043e\u0432\u0438\u0442\u044c \u0441\u043a\u0440\u0438\u043f\u0442?') )
					{
						location.href = 'http://userscripts.org/scripts/source/' + script_id + '.user.js';
					}
				}
			});
		}
	}
	
	function toMetadata( string )
	{
		var m_arr = string.split('\n');
		var metadata_arr = new Array();
		for ( var i = 0; i < m_arr.length; i++ )
		{
			if ( /\/\/ @\w*\s*.*/.test(m_arr[i]) )
			{
				var metadata = m_arr[i].match(/\/\/ @(\w*)\s*(.*)/);
				metadata_arr[metadata[1]] = metadata[2];
			}
		}
		return metadata_arr;
	}